FILLER.Desc:
special values: %a = application name; %u = user name; %d = database name; %r = remote host and port; %h = remote host; %p = process ID;
%t = timestamp without milliseconds; %m = timestamp with milliseconds; %i = command tag; %e = SQL state; %c = session ID; %l = session line number;
%s = session start timestamp; %v = virtual transaction ID; %x = transaction ID (0 if none); %q = stop here in non-session processes; %% = '%'
